INSERT INTO `movie` VALUES (116,'2024-01-30 00:00:00.000000','2024-01-06 00:00:00.000000','là một bộ phim điện ảnh Anh – Mỹ thuộc thể loại nhạc kịch – kỳ ảo – chính kịch ra mắt vào năm 2023 do Paul King viết kịch bản kiêm đạo diễn.','mv29755','04fae7c2-5a1e-4a30-b9a5-33fa02a1bbe3','wonka.jpg','WONKA ','e28fcf8b-0281-41ab-a36a-942343485637','Sắp chiếu','https://www.youtube.com/embed/otNh9bTjXWg'),(109,'2024-01-30 00:00:00.000000','2024-01-09 00:00:00.000000','Thiện ác đối đầu là một bộ phim hành động tội phạm Mỹ năm 2014 do Antoine Fuqua đạo diễn và Richard Wenk viết kịch bản, dựa trên loạt phim truyền hình nổi tiếng cùng tên. Phim có sự tham gia của Denzel Washington, Chloë Grace Moretz, Marton Csokas, David Harbour, Bill Pullman và Melissa Leo.','mv15851','1b52c495-28e3-495b-9e1e-def598d7fb63','thien-ac-doi-dau.jpg','THIỆN ÁC ĐỐI ĐẦU','d1cd622b-2eef-4a99-a565-8c7aa902c02d','Đang chiếu','https://www.youtube.com/embed/Z82z-Ky-tBg'),(83,'2024-01-30 00:00:00.000000','2024-01-12 00:00:00.000000','Nhóm Công cố gắng chạy đến chuyến phà cuối cùng ở vùng hạ lưu sông Mekong để thoát khỏi cù lao. Tuy nhiên, Diễm (Ốc Thanh Vân) - một thành viên trong nhóm - phản bội, khiến nhóm người buộc phải tách ra. Giữa dịch bệnh, họ nhận ra lòng oán hận, ích kỷ mới là thứ đẩy con người vào thử thách sống còn.','mv47244','2a2b67d7-6729-405a-a7f4-14b456652e41','ben-pha-xac-song.jpg','BẾN PHÀ XÁC SỐNG','e28fcf8b-0281-41ab-a36a-942343485637','Đang chiếu','https://www.youtube.com/embed/b5kt0zjYpVw'),(124,'2024-01-30 00:00:00.000000','2023-12-15 00:00:00.000000','Đến từ Studio Ghibli và đạo diễn Miyazaki Hayao, bộ phim là câu chuyện về hành trình kỳ diệu của cậu thiếu niên Mahito trong một thế giới hoàn toàn mới lạ. Trải qua nỗi đau mất mẹ cùng mối quan hệ chẳng mấy vui vẻ với gia đình cũng như bạn học, Mahito dần cô lập bản thân... cho đến khi cậu gặp một chú chim diệc biết nói kỳ lạ. Mahito cùng chim diệc bước vào một tòa tháp bí ẩn, nơi một thế giới thần kỳ mở ra, đưa cậu gặp gỡ những người mình yêu thương... trong một nhân dạng hoàn toàn khác.','mv21646','32f60ea6-81be-46f0-bf1e-88d120ea9d91','thieu-nien-va-chim-diec.jpg','THIẾU NIÊN VÀ CHIM DIỆC','a3bbb814-f3bb-4ded-a019-aa2444bc8cd2','Đang chiếu','https://www.youtube.com/embed/eggzAobZzHc'),(105,'2024-01-11 00:00:00.000000','2024-01-10 00:00:00.000000','hhhh','mv50136','48701076-dae4-4518-8d93-650c16876cb2','mat_vu_ong.jpg','MẬT VỤ ONG','d39569c3-49f7-4fde-a8af-033669f30b62','Đã chiếu','https://www.youtube.com/embed/566MCdQI2Ps?si=aXEaMX1fRqlEpHVx'),(68,'2024-01-30 00:00:00.000000','2023-12-15 00:00:00.000000','Hiện tượng văn hóa tiếp tục trên màn ảnh lớn! Đắm chìm trong trải nghiệm xem phim hòa nhạc độc nhất vô nhị với góc nhìn ngoạn mục, đậm chất điện ảnh về chuyến lưu diễn mang tính lịch sử. Khuyến khích khán giả đeo vòng tay tình bạn và mặc trang phục Taylor Swift Eras Tour!','mv31977','4e6a171a-3d88-4690-bde8-1591c8495f6c','taylor-swift.jpg','NHỮNG KỶ NGUYÊN CỦA TAYLOR SWIFT','e28fcf8b-0281-41ab-a36a-942343485637','Đang chiếu','https://www.youtube.com/embed/cwLAor_smGw'),(110,'2024-01-30 00:00:00.000000','2024-01-16 00:00:00.000000','Năm đêm kinh hoàng (tựa tiếng Anh: Five Nights at Freddy\'s) là một bộ phim điện ảnh Mỹ thuộc thể loại kinh dị – siêu nhiên – giật gân ra mắt vào năm 2023 được Emma Tammi đạo diễn từ kịch bản mà cô cùng viết với Scott Cawthon và Seth Cuddeback','mv94790','69a23aed-1834-4dfd-82f4-128a1c98f2dc','nam-dem-kinh-hoang.jpg','NĂM ĐÊM KINH HOÀNG','a3bbb814-f3bb-4ded-a019-aa2444bc8cd2','Sắp chiếu','https://www.youtube.com/embed/J7XVzwEdUNw'),(94,'2024-01-30 00:00:00.000000','2024-01-10 00:00:00.000000','Shin Movie 31 xoay quanh câu chuyện về hai nguồn sáng đặc biệt từ vũ trụ mang theo siêu năng lực đặc biệt tới Trái Đất. Một nguồn sáng tích cực “nhập” vào nhóc Shin, khiến cặp mông núng nính của cậu chàng trở nên nóng bỏng và có khả năng điều khiển những đồ vật xung quanh theo ý muốn.','mv65153','7c12b34c-908a-49d3-8aa3-e67ec815aa75','shin-cau-be-but-chi.jpg','Shin Cậu Bé Bút Chì Movie 31: Đại Chiến Siêu Năng Lực Sushi Bay','aba1be2a-0783-45f7-89b6-322cdd87a9f7','Đang chiếu','https://www.youtube.com/embed/O9KQxT8HR_8'),(120,'2024-01-30 00:00:00.000000','2024-01-01 00:00:00.000000','Nghệ thuật săn quỷ và nấu mì là một bộ phim truyền hình Hàn Quốc ra mắt năm 2020, với sự tham gia của Jo Byung-gyu, Kim Se-jeong và Yum Hye-ran, dựa trên webtoon Daum Amazing Rumor của Jang Yi.[2] Do Yoo Sun-dong đạo diễn, bộ phim kể về câu chuyện của những linh hồn ma quỷ từ thế giới bên kia xuống Trái đất để có cuộc sống vĩnh hằng và nhóm thợ săn hồn ma được gọi là “Khắc tinh” được cử đến Trái đất để bắt chúng.','mv47854','8089b987-957f-4e53-a584-f02df872bce5','nghe-thuat-san-quy.jpg','NGHỆ THUẬT SĂN QUỶ VÀ NẤU MÌ 2','a3bbb814-f3bb-4ded-a019-aa2444bc8cd2','Đang chiếu','https://www.youtube.com/embed/lDkEsU4YSNs'),(93,'2024-01-30 00:00:00.000000','2024-01-17 00:00:00.000000','Một nhóm bạn phát hiện ra bàn tay ma quái cho phép họ triệu hồi các linh hồn bí ẩn. Họ dần bị cuốn vào trò chơi này mà không biết rằng một trong số họ đã đi quá xa và giải phóng thế lực hắc ám kinh hoàng.','mv94926','a24101ff-5a59-4a07-8b2f-c9474004d8fd','goi-hon-quy-du.jpg','GỌI HỒN QUỶ DỮ','d1cd622b-2eef-4a99-a565-8c7aa902c02d','Sắp chiếu','https://www.youtube.com/embed/tMGH7dSzyP0'),(103,'2024-01-30 00:00:00.000000','2024-01-06 00:00:00.000000','Vì công việc, một nữ biên tập sợ hãi cuộc sống độc thân đã được hợp tác với anh nhà văn đẹp trai, nổi tiếng nhưng mất niềm tin vào tình yêu đích thực. Cả hai sẽ kết hợp ra sao để tạo nên “bí kíp sinh tồn” qua mùa Noel cho hội ế lâu năm?','mv68495','a9c037ed-9669-4002-9165-7e4b5717f012','mot-minh-van-on.jpg','MỘT MÌNH VẪN ỔN\'T','a3bbb814-f3bb-4ded-a019-aa2444bc8cd2','Sắp chiếu','https://www.youtube.com/embed/g0ddV0_Cogc'),(124,'2024-01-30 00:00:00.000000','2024-01-16 00:00:00.000000','Aquaman là nhân vật siêu anh hùng hư cấu xuất hiện trong truyện tranh của Mỹ, được công bố bởi DC Comics. Nhân vật được tạo ra bởi Paul Norris và Mort Weisinger, xuất hiện lần đầu tiên trong More Fun Comics (tháng 11 năm 1941).','mv61060','abf16eeb-d83a-41cb-ad71-85b05df98600','aquaman.jpg','AQUAMAN VÀ VƯƠNG QUỐC THẤT LẠC','a3bbb814-f3bb-4ded-a019-aa2444bc8cd2','Sắp chiếu','https://www.youtube.com/embed/OmUKJ2izSg8'),(129,'2024-01-30 00:00:00.000000','2024-01-17 00:00:00.000000','Được nhận xét là một “chuẩn mực mới về phản địa đàng trong dòng phim thảm họa Hàn Quốc”, bom tấn ĐỊA ĐÀNG SỤP ĐỔ xoay quanh cơn đại địa chấn san bằng Seoul thành bình địa và hành trình sinh tồn của những người sống sót.','mv2252','b5a2d7fc-6c8c-4846-b831-7f28fd655134','dia-dang-sup-do.jpg','ĐỊA ĐÀNG SỤP ĐỔ','e28fcf8b-0281-41ab-a36a-942343485637','Sắp chiếu','https://www.youtube.com/embed/HCPx2ReKkBg'),(157,'2024-01-30 00:00:00.000000','2024-01-16 00:00:00.000000','Đấu trường sinh tử kể lại câu chuyện của Katniss Everdeen, một cô gái 16 tuổi từ Quận 12 đã tình nguyện làm vật tế cho Đấu trường sinh tử lần thứ 74 để thay thế cho người em gái của mình là Prim.','mv55896','d204289a-170f-4530-a4ee-499bb99520f6','dau-truong-sinh-tu.jpg','ĐẤU TRƯỜNG SINH TỬ: KHÚC HÁT CỦA CHIM CA VÀ RẮN ĐỘC','e28fcf8b-0281-41ab-a36a-942343485637','Sắp chiếu','https://www.youtube.com/embed/QsEfBzLoKys'),(120,'2024-01-30 00:00:00.000000','2024-01-13 00:00:00.000000','Siêu phẩm học đường \"CÔ GÁI NĂM ẤY CHÚNG TA TỪNG THEO ĐUỔI\" trở lại với phiên bản Thái Lan. Mối tình trong trẻo được tái hiện bởi cặp đôi Nanon (vai Tong) và Film (vai Lin) sẽ khiến khán giả bồi hồi về tình yêu đầu đời trên ghế nhà trường. Tong, cậu nhóc học sinh cá biệt được chuyển bàn ngồi trước Lin, một cô gái chăm chỉ, mọt sách, có vẻ ngoài bí ẩn và là đối tượng theo đuổi của nhiều chàng trai trong trường. Qua những lời thách thức từ \"lũ bạn thân trời đánh\" của Tong, cả hai dần nhận ra tình cảm đặc biệt họ dành cho nhau.','mv10676','d87e89a0-0cfb-4f1b-afb4-e673e930219d','chau-bau-doi-toi.jpg','CHÂU BÁU ĐỜI TÔI','e28fcf8b-0281-41ab-a36a-942343485637','Đang chiếu','https://www.youtube.com/embed/e9Ai0tuccxE'),(103,'2024-01-30 00:00:00.000000','2024-01-17 00:00:00.000000','Phim lấy bối cảnh tại thành phố Venice, Ý, nơi thám tử Poirot đang nghỉ hưu. Ông được mời đến dự một buổi lễ gọi hồn cho con gái của một ngôi sao opera đã tự sát một năm trước. Tuy nhiên, trong buổi lễ, một vụ án mạng đã xảy ra, khiến tất cả những người có mặt trở thành nghi can.','mv36086','e7e92b91-a096-4e79-ba7a-831199599b13','an-mang-o-venice1.jpg','ÁN MẠNG Ở VENICE','a3bbb814-f3bb-4ded-a019-aa2444bc8cd2','Sắp chiếu','https://www.youtube.com/embed/KaQdjPveUU8');



